// 930. 和相同的二元子数组 https://leetcode-cn.com/problems/binary-subarrays-with-sum/

function numSubarraysWithSum(A: number[], S: number): number {
    if (A.length === 0) return 0;
    const lenA = A.length;
    let total = 0;
    let sumArr: number[] = [0];
    let sum = 0;
    A.forEach((v, i) => {
        sum +=v;
        sumArr[i+1] = sum;
    })
    for (let left = 0; left <= lenA - 1; left++) {
        for (let right = left + 1; right <= lenA; right++) {
            if ((sumArr[right] - sumArr[left]) === S) {
                total++;
            }
            if ((sumArr[right] - sumArr[left]) > S) {
                break;
            }
        }
    }
    return total;
};

